<?phpnamespace Nemundo\Package\OpenGraph;use Nemundo\Com\Html\Header\LibraryHeader;use Nemundo\Web\ResponseConfig;abstract class AbstractUrlOpenGraph extends AbstractOpenGraph{    public $pageTitle;    public $pageDescription;    public $pageImage;    public function getContent()    {        //$this->prefix = 'og';        $this->addMeta('title', $this->pageTitle);  // LibraryHeader::$documentTitle); // $this->title);        $this->addMeta('description', $this->pageDescription);  // ResponseConfig::$description);        $this->addMeta('image', $this->pageImage);  // ResponseConfig::$imageUrl);        return parent::getContent();    }}